import { Component } from '@angular/core';


@Component({
  selector: 'app-resgate-cdb',
  templateUrl: './resgate-cdb.component.html',
  styleUrls: ['./resgate-cdb.component.css'] 
})
export class ResgateCdbComponent {

  decimalValue: number = 0;
  integerValue: number = 0;

}
<div class="input-panel">
    <h2 class="panel-title">CDB Resgate</h2>
    <form>
        <label for="decimalInput">Inform o valor de resgate:</label>
    <input type="number" id="decimalInput" [(ngModel)]="decimalValue" step="0.01" 
    placeholder="Informe o valor do resgate">

    <label for="integerInput">Valor Inteiro:</label>
    <input type="number" id="integerInput" [(ngModel)]="integerValue" step="1">

    </form>


  </div>
